.footer{
	width: 100%;
	height: auto;
	margin: 0 auto;
}
.footer__up{
	width: 100%;
	min-height: 251px;
	margin: 0 auto;
	background-color: #353C65;
	padding: 70px 0;
	display: flex;
	justify-content: center;
	@media screen and (min-width: 320px) and (max-width: 767px){
		flex-direction: column;
		align-items: center;
		padding-bottom: 10px;
	}
}
.footer__bot{
	width: 100%;
	min-height: 91px;
	margin: 0 auto;
	background-color: #2C3154;
	display: flex;
	justify-content: center;
	align-items: center;
}
.footer__up-item1{
	width: 370px;
	height: auto;
	@media screen and (min-width: 320px) and (max-width: 767px){
	margin-bottom: 20px;
	}
	@media screen and (min-width: 320px) and (max-width: 479px){
		width: 310px;
		padding: 0 20px;
	}

}
.footer__up-item2{
	width: 370px;
	height: auto;
	display: flex;
	flex-direction: column;
	justify-content: space-between;
	align-items: center;
	@media screen and (min-width: 320px) and (max-width: 767px){
		margin-bottom: 20px;
		}
	@media screen and (min-width: 320px) and (max-width: 479px){
		width: 170px;
	}
}
.footer__up-item3{
	max-width: 370px;
	height: auto;
	@media screen and (min-width: 768px) and (max-width: 1024px){
		width: 370px;
	}
	@media screen and (min-width: 320px) and (max-width: 479px){
		padding: 0 20px;;
	}

}
.footer__up-item2-social{
	margin-top: 25px;
	width: 170px;
	display: flex;
	justify-content: space-between;
}
.copyright{
	width: 370px;
	height: 42px;
	@media screen and (min-width: 320px) and (max-width: 479px){
		padding: 0 20px;;
	}
}
.copyright-span{
	color:white;
}
